import{_ as g,k as t,p as s,ac as E}from"./chunks/framework.DA7r4KNg.js";const a="/assets/202303111678521133434113.DuNHlc9g.png",p="/assets/202303111678521215279987.zCZNZgl1.png",n="/assets/202303111678521274370265._WbYnuki.png",r="data:image/png;base64,",c="/assets/202303111678521395316971.D9M6V1YF.png",C="/assets/202303111678521413854347.vC9_3c3f.png",o="data:image/png;base64,",i="data:image/png;base64,",I="data:image/png;base64,",P="/assets/202303111678521619679475.DPNUVWyC.png",e="/assets/202303111678521681825380.BkgApB3o.png",j="data:image/png;base64,",B="/assets/202303111678521855662940.DCwydguQ.png",Y="/assets/202303111678521853247670.DIyhO0qk.png",Q="data:image/png;base64,",S="/assets/202303111678522367546933.C08Pdoy2.png",b="data:image/png;base64,",H=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"wenzhang/汉心字根由来.md","filePath":"wenzhang/汉心字根由来.md"}'),x={name:"wenzhang/汉心字根由来.md"};function R(l,A,L,m,M,f){return s(),t("div",null,A[0]||(A[0]=[E('<p><img src="'+a+'" alt="字元"></p><p><strong>字元</strong></p><p>拼音的字根,大部分都必须是和读音对应.不然难记.</p><p>然后为什么还有不和读音对应了,因为为了减少重码</p><p><img src="'+p+'" alt="字元"></p><p><strong>字元</strong></p><p>山为什么放s上.因为u上的字根重码很多,我当时一个一个试.试了好多字根 。最后发现只有山可以把整体重码降下去.这个记不清有没有参考鹤形了.当时就u键字根涵盖的字非常多.重码也多.就想给u键重码降低一下。</p><p><img src="'+n+'" alt="字元"></p><p><strong>字元</strong></p><p>这个字根主要继承易学码的思路</p><p><img src="'+r+'" alt="字元"></p><p><strong>字元</strong></p><p>这个其实取口最好.但是重码太多.所以安排在z键上了.汉心码的口字旁键上的字非常多.就试出来这个字根放到其他键上可以降低k键的重码率</p><p><img src="'+c+'" alt="字元"></p><p><strong>字元</strong></p><p>这个其实和折类似.就都放一起了.你想不起,取折,也会碰对</p><p><img src="'+C+'" alt="字元"></p><p><strong>字元</strong></p><p>其实本来不想要这个字根的.但是这样的字又有很多,本来是放y上的.但是放y上重码又有很多.所以就安排在h键上了</p><p><img src="'+o+'" alt="字元"></p><p><strong>字元</strong></p><p><img src="'+i+'" alt="字元"></p><p><strong>字元</strong></p><p>这两个有参考快手码,单码离散性更好.重码更低一点.</p><p><img src="'+I+'" alt="字元"></p><p><strong>字元</strong></p><p>这个为什么不放m上.因为m重码超级多.然后试了一圈,最后发现L键重码低.就放l键了.正好l键和林对应,也好记.</p><p>题外话,m键上重码超级多.我试了好多,比如给马移到其他键上,然后看重码.放在各种键上重码都降低不了.又把目放其他键上.也是降低不了太多.然后我还是用表格函数计算重复值的.特别繁琐,计算一次都几分钟还是十几分钟忘记了.反正很慢.</p><p><img src="'+P+'" alt="字元"></p><p><strong>字元</strong></p><p>这个很多人感觉像木,应该放m上.m的重码很多.所以就没安排m上.其实如果不懂穿插不取的人,会把这个字根看成小字.但是取不了小字.但是我把它放到x上了.你就可以取小字了.也有这个考虑.</p><p><img src="'+e+'" alt="字元"></p><p><strong>字元</strong></p><p>这个本来是没有的.但是后期改规则后,没有这样的字根,会很麻烦,就放了两个上去</p><p><img src="'+j+'" alt="字元"></p><p><strong>字元</strong></p><p>这个其实是参考自然码的.个人只会一点点自然码,使用过程感觉两个放一起很省事,你不用分那么清楚是横还是竖。然后通过计算，两个放一起重码也不会明显增多。所以他两放一起很合适。</p><p><img src="'+B+'" alt="字元"></p><p><strong>字元</strong></p><p>这个常规基本大家都这样安排,啥原因,我也不清楚,可能是重码低</p><p><img src="'+Y+'" alt="字元"></p><p><strong>字元</strong></p><p>这两个放一起感觉也方便.因为提笔忘字,想不起分不清是那个部</p><p><img src="'+Q+'" alt="字元"></p><p><strong>字元</strong></p><p>戈字根思路继承于易学码</p><p><img src="'+S+'" alt="字元"></p><p><strong>字元</strong></p><p>目很多码都会放o上.只是个人记不住,不习惯,所以目就放m上了</p><p><img src="'+b+'" alt="字元"></p><p><strong>字元</strong></p><p>这个很多码会把它放d上.说这个是刀字.当时学自然码的时候,就感觉理解不了.所以就不会给它放d上.编易学的时候给它放q上.但是作汉心码的时候发现放e上重码更低.而且e上字根太少了.就给移一点过来.其实d上的重码也多.不放d上反而有好处.有更好的离散性。就是重码低的意思。</p><p><strong>汉心码设计思想</strong></p><p><strong>尽可能的不要字根-继承自易学码</strong></p><p><strong>字根必须要少，规则要简单</strong></p><p><strong>难记的字根也必须少</strong></p>',56)]))}const G=g(x,[["render",R]]);export{H as __pageData,G as default};
